/*Table structure for table `em_work_order` */

DROP TABLE IF EXISTS `em_work_order`;

CREATE TABLE `em_work_order` (
  `id` char(32) NOT NULL,
  `worknum` varchar(32) DEFAULT NULL COMMENT '工单编号',
  `worktype` varchar(10) DEFAULT NULL COMMENT '工单类型',
  `name` varchar(32) DEFAULT NULL COMMENT '工单简述',
