/*Table structure for table `em_work_plan_list` */

DROP TABLE IF EXISTS `em_work_plan_list`;

CREATE TABLE `em_work_plan_list` (
  `id` int(32) NOT NULL AUTO_INCREMENT,
  `worktype` varchar(10) DEFAULT NULL,
  `emcode` varchar(32) DEFAULT NULL COMMENT '分类编码',
