  `penddate` datetime DEFAULT NULL COMMENT '组织机构',
  `name` varchar(100) DEFAULT NULL,
  `standardcode` varchar(32) DEFAULT NULL,
  `strategycode` varchar(32) DEFAULT NULL,
  `approve_by` varchar(32) DEFAULT NULL,
  `isworkorder` char(1) DEFAULT NULL,
  `status` tinyint(4) DEFAULT NULL,
  `create_by` varchar(32) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(32) DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `remark` varchar(255) DEFAULT NULL,
  `advancetime` varchar(255) DEFAULT NULL,
  `priority` varchar(255) DEFAULT NULL COMMENT '优先级',
  `del_flag` char(1) DEFAULT NULL,
  `create_byMC` varchar(32) DEFAULT NULL,
  `update_byMC` varchar(32) DEFAULT NULL,
  `approve_byMC` varchar(32) DEFAULT NULL,
  `dept` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2867 DEFAULT CHARSET=utf8;

