/* Function  structure for function  `fun_em_currval` */

/*!50003 DROP FUNCTION IF EXISTS `fun_em_currval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`mes`@`%` FUNCTION `fun_em_currval`(`v_seq_name` varchar(50)) RETURNS varchar(24) CHARSET utf8
BEGIN
	#Routine body goes here...
	declare value VARCHAR(24); 
	DECLARE cny VARCHAR(6);
	DECLARE sl INT;

  SELECT DATE_FORMAT(NOW(),'%Y%m') INTO cny FROM DUAL; 
	
	SELECT count(*) into sl from  em_autocode where ny=cny AND seq_name = v_seq_name; 
	if(sl=0) then
			INSERT into em_autocode(seq_name,pre,suff,increment_val,current_val,ny)
											 VALUES(v_seq_name,v_seq_name,'',1,1,cny);
	end if;
	
  SELECT CONCAT(pre,ny,LPAD(current_val,4,0))  into value  from em_autocode where ny=cny AND seq_name = v_seq_name; 
   return value;
END */$$
DELIMITER ;

/* Function  structure for function  `fun_em_nextval` */

/*!50003 DROP FUNCTION IF EXISTS `fun_em_nextval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`mes`@`%` FUNCTION `fun_em_nextval`(`v_seq_name` varchar(50)) RETURNS varchar(24) CHARSET utf8
BEGIN
	#Routine body goes here...
	DECLARE cny VARCHAR(6);
	DECLARE sl INT;

	SELECT DATE_FORMAT(NOW(),'%Y%m') INTO cny FROM DUAL; 
	
	SELECT count(*) into sl from  em_autocode where ny=cny AND seq_name = v_seq_name; 
	if(sl=0) then
			INSERT into em_autocode(seq_name,pre,suff,increment_val,current_val,ny)
											 VALUES(v_seq_name,v_seq_name,'',1,0,cny);
	end if;

	update em_autocode set current_val = current_val + increment_val  where ny=cny AND seq_name = v_seq_name; 
  return fun_em_currval(v_seq_name);
END */$$
DELIMITER ;

/* Procedure structure for procedure `prc_dim_day` */

/*!50003 DROP PROCEDURE IF EXISTS  `prc_dim_day` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`mes`@`%` PROCEDURE `prc_dim_day`(in  start_date varchar(20),in date_count int)
begin
declare i int;
set i=0;
DELETE from dim_day;
while i<date_count  do
INSERT into dim_day
(DAY_SHORT_DESC)
SELECT DATE_FORMAT(STR_TO_DATE(start_date,'%Y-%m-%d %H:%i:%s'),'%Y-%m-%d')  from dual;
set i=i+1;
set start_date = DATE_FORMAT(date_add(STR_TO_DATE(start_date,'%Y-%m-%d %H:%i:%s'),interval 1 day),'%Y-%m-%d');
end while;
end */$$
DELIMITER ;

/* Procedure structure for procedure `prc_genWorkOrder_byWorkPlan` */

/*!50003 DROP PROCEDURE IF EXISTS  `prc_genWorkOrder_byWorkPlan` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`mes`@`%` PROCEDURE `prc_genWorkOrder_byWorkPlan`()
BEGIN
-- 每天1点执行 根据作业计划+工单生成提前期生成工单、工单任务清单、任务资源（工单流程如何启动？） JOB 
  -- 修改已生成工单的作业计划的状态
  -- 修改作业策略中的下一个工单日
DECLARE v_currentDate DATE DEFAULT DATE_FORMAT(NOW(), '%Y-%m-%d'); -- 当天的不生成工单


-- 工单主表
INSERT INTO em_work_order (id, worknum, worktype, name, emcode, emname, workstandard, 
														source, pstartdate, penddate, org, dept,sourceid, del_flag, status, 
														create_by, create_date, priority,approve_by,approve_byMC,check_by) 
(SELECT id,fun_em_nextval('WO'),worktype,CONCAT(emname,':',name), emcode,emname,standardcode,
				'作业计划',pstartdate,penddate, '恒盛分公司',a.dept,id,'0','001','system',NOW(),priority,
				a.approve_by,a.approve_byMC,(select cd.checker from em_cyclework_distribute cd where cd.emcode = a.emcode AND cd.del_tag='0')
	FROM em_work_plan_list a 
	where v_currentDate<=a.pstartdate AND date_add(v_currentDate,interval CONVERT(a.advancetime,SIGNED) day)>=a.pstartdate
				and a.isworkorder='0' AND a.del_flag='0');

-- 工单任务表
INSERT INTO em_standard_act_task(
			main_id, id, tasknum, duration, status, create_by, create_date, del_flag
		)
(SELECT a.id,CONCAT(a.id,d.id),d.tasknum,d.duration,'0','system',NOW(),'0'
					FROM em_work_plan_list a,em_work_plan_strategy b,em_work_standard c,em_work_standard_task d
					WHERE c.id=d.main_id AND b.standardcode=c.`code` AND a.standardcode=b.`code` 
								AND v_currentDate<=a.pstartdate AND date_add(v_currentDate,interval CONVERT(a.advancetime,SIGNED) day)>=a.pstartdate
								AND a.isworkorder='0' AND a.del_flag='0');
-- 工单任务资源表
INSERT INTO em_standard_act_task_parts(
			task_id, id, tasknum, partcode, partname, partnumber, status, create_by, create_date,  del_flag
		)
(SELECT CONCAT(a.id,d.id),CONCAT(a.id,e.id),e.tasknum,e.partcode,e.partname,e.partnumber,'0','system',NOW(),'0'
					FROM em_work_plan_list a,em_work_plan_strategy b,em_work_standard c,em_work_standard_task d,em_work_standard_task_parts e
					WHERE e.task_id=d.id and c.id=d.main_id AND b.standardcode=c.`code` AND a.standardcode=b.`code` 
								AND v_currentDate<=a.pstartdate AND date_add(v_currentDate,interval CONVERT(a.advancetime,SIGNED) day)>=a.pstartdate
								AND a.isworkorder='0' AND a.del_flag='0');



UPDATE em_work_plan_strategy b SET b.nextday=(CASE b.rateunit 
																							WHEN '年' THEN date_add(b.nextday,INTERVAL b.ratenumber YEAR)
																							WHEN '月' THEN date_add(b.nextday,INTERVAL b.ratenumber MONTH)
																							ELSE date_add(b.nextday,INTERVAL b.ratenumber DAY)
																							END)
	WHERE EXISTS (SELECT id 
									FROM em_work_plan_list a 
									where b.`code` = a.strategycode 
												AND v_currentDate<=a.pstartdate  
												AND date_add(v_currentDate,interval CONVERT(a.advancetime,SIGNED) day)>=a.pstartdate
												and a.isworkorder='0' AND a.del_flag='0')
				AND b.del_flag='0';

UPDATE em_work_plan_list a  SET isworkorder='1'
	where  v_currentDate <= a.pstartdate AND date_add(v_currentDate,interval CONVERT(advancetime,SIGNED) day)>=pstartdate
				and isworkorder='0' AND del_flag='0';

END */$$
DELIMITER ;

/* Procedure structure for procedure `prc_genWorkPlan_byStrategy` */

/*!50003 DROP PROCEDURE IF EXISTS  `prc_genWorkPlan_byStrategy` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`mes`@`%` PROCEDURE `prc_genWorkPlan_byStrategy`()
BEGIN
-- 每天0点执行 根据作业策略定义，更新从即日起~今年底的作业计划   JOB
	-- 针对(当天)修改过的策略进行操作   em_work_plan_strategy-->ischange
    -- 每年第一天，重置ischange，生成新年的计划
		-- 删除从即日起的计划清单(已经生成工单的不删除）
		-- 循环作业策略
		-- 循环策略内设备
			-- 插入计划清单(从下一工单日开始推算,下一工单日由工单生成存储过程更新）
				-- 插入清单对应任务、任务资源
	-- 恢复策略修改状态
DECLARE v_currentYear DATE DEFAULT DATE_SUB(CURDATE(),INTERVAL dayofyear(now())-1 DAY);
DECLARE v_nextYear DATE;
DECLARE done INT DEFAULT 0;
DECLARE v_nextday DATE;
DECLARE v_advaDay INT DEFAULT 30;  -- 年前天数
DECLARE v_id,v_rateunit,v_ratenumber,v_name,v_worktype,v_advancetime,v_standardcode,v_emcode,v_code,v_priority VARCHAR(100);

DECLARE c_strategy CURSOR FOR SELECT a.id,a.nextday,a.rateunit,a.ratenumber,a.name,a.worktype,a.advancetime,a.standardcode,a.`code`,priority
											FROM em_work_plan_strategy as a 
											WHERE a.del_flag='0' AND a.ischange='1' AND a.status='1'; 
DECLARE c_equipment CURSOR FOR SELECT b.emcode
											FROM em_work_plan_strategy_eq as b 
											WHERE b.del_flag='0' AND b.main_id=v_id; 
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done=1;

-- 当前日期+30<年底 v_nextYear是下一年第一天
-- 当前日期+30=年底 重置ischange，v_nextYear是下下年第一天
-- 当前日期+30>年底  v_nextYear是下下年第一天

set v_nextYear = date_add(v_currentYear,interval 1 YEAR);

-- 每年第一天，重置ischange，生成新年的计划
IF date_add(CURDATE(),interval v_advaDay DAY) < v_nextYear  THEN  
        set v_nextYear = date_add(v_currentYear,interval 1 YEAR);
ELSEIF date_add(CURDATE(),interval v_advaDay DAY) = v_nextYear  THEN  
        set v_nextYear = date_add(v_currentYear,interval 2 YEAR);
				UPDATE em_work_plan_strategy SET ischange='1' WHERE del_flag='0' AND ischange='0' AND status='1';
ELSE  
        set v_nextYear = date_add(v_currentYear,interval 2 YEAR);
END IF; 

DELETE a FROM em_work_plan_list a  
					WHERE /* a.pstartdate>v_currentYear and */ 
								a.isworkorder='0'
								AND EXISTS (SELECT 1 FROM em_work_plan_strategy b 
																			where a.strategycode=b.`code` 
																						and b.del_flag='0' 
																						AND b.ischange='1');

open c_strategy;
cs_loop:loop
fetch c_strategy into v_id,v_nextday,v_rateunit,v_ratenumber,v_name,v_worktype,v_advancetime,v_standardcode,v_code,v_priority;
if done=1 then
    leave cs_loop;
end if;

		/* OPEN c_equipment;
		ce_loop:loop
		fetch c_equipment into v_emcode;
		if done=1 then
				leave ce_loop;
		end if;
		*/
				while v_nextday < v_nextYear  do
					INSERT into em_work_plan_list
						      (worktype,emcode,emname,pstartdate,penddate,name,standardcode,strategycode,approve_by,approve_byMC,
										isworkorder,status,create_by,create_date,del_flag,advancetime,dept,priority)
					(SELECT v_worktype,b.emcode,(SELECT d.emname from em_equipment d where d.emcode=b.emcode) AS emname,
									v_nextday,v_nextday,CONCAT(v_name,':',b.emcode),v_standardcode,v_code,c.`user`,C.userMC,
									'0','0','system',NOW(),'0',v_advancetime,c.dept,v_priority
					FROM em_work_plan_strategy_eq as b,em_cyclework_distribute as c
					WHERE c.worktype=v_worktype AND b.emcode=c.emcode AND b.del_flag='0' AND b.main_id=v_id); 
					
						IF v_rateunit = '年'  
						THEN  
								set v_nextday = date_add(v_nextday,interval v_ratenumber YEAR);
						ELSEIF v_rateunit = '月'  
						THEN  
								set v_nextday = date_add(v_nextday,interval v_ratenumber MONTH);
						ELSE      -- 日
								set v_nextday = date_add(v_nextday,interval v_ratenumber day);
						END IF; 
					
				end while;
		/* end loop ce_loop;
		close c_equipment;
		*/
end loop cs_loop;
close c_strategy;

UPDATE em_work_plan_strategy SET ischange='0' WHERE del_flag='0' AND ischange='1' AND status='1'; 
END */$$
DELIMITER ;

/* Procedure structure for procedure `prc_updateRunningState_byWorkOrder` */

/*!50003 DROP PROCEDURE IF EXISTS  `prc_updateRunningState_byWorkOrder` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`mes`@`%` PROCEDURE `prc_updateRunningState_byWorkOrder`()
BEGIN
-- 每天23:50点执行 后一天要开始的工单，设备运行状态置为002（维保）
DECLARE v_nextDate DATE DEFAULT DATE_FORMAT(date_add(NOW(),interval 1 day),'%Y-%m-%d') ;


-- 工单主表
UPDATE em_equipment b SET b.running_state = '002'
WHERE EXISTS
(SELECT 1 FROM em_work_order a 
					WHERE a.emcode = b.emcode
								AND v_nextDate = DATE_FORMAT(a.pstartdate,'%Y-%m-%d')
								AND worktype='001' AND source='作业计划' AND workflowid is NULL AND del_flag='0');

END */$$
DELIMITER ;

